import { Data, Params } from 'src/request/entity.d';
import { put, post } from "src/request/api"
export const queryPages = (params: Params) => {
 const headers = { 'Content-Type': 'application/x-www-form-urlencoded;charset=utf-8' }
 return put('/api/v1/app/mine/query-trans-log', params, headers)
}
export const statistics = (data: Data) => {
 return put('/api/v1/app/mine/query-coin-statistics', data)
}
